import React from "react";

const UsersItem = (props) => {
    return (
        <div>
            {props.name}
            <br/>
        </div>
    );
}

const Users = (props) => {
    console.log(props);
    let users = props.users.map(u => (
        <div>
            <div>
                {u.name}
                <br/>
            </div>
            <button onClick={() => props.unfollow(u.id)}> follow</button>
        </div>));
    return <div> {users} </div>
}

export default Users;
